import React from 'react';
import styled from 'styled-components';

const Div = styled.div`
    width: 40%;
    height: 100%;
    border: 1px solid green;
    display: flex;
    flex-direction: column;
`

const SelectLeft = () => {
    return (
        <Div>
            SelectLeft
        </Div>
    );
};

export default SelectLeft;
